import React from 'react';
import login from './components/login.js';
import {Container, Button, Form, Item, Input} from "react-bootstrap";

function App() {
  return (
    <>
    <login />
    <Container style={{flex:1, flexDirection:'row', alignItems:'center', justifyContent:'center',}}>
      <Form style={{}}>

      <Item last>
        <Input placeholder='Username' 
          style={{color:'white'}}/>
        </Item>
        <Item last>
            <Input placeholder="Password"
            style={{color:'white'}} />
        </Item>
      <Button style={{width:170,backgroundColor:'#99004d',marginTop:20,}}>
        <text style={{marginLeft:50}}>Login</text>
      </Button>

      </Form>

    </Container>
    
    
    </>
  )
}


export default App;
